import { styled } from "styled-components";

export const Container = styled.div`
  position: absolute;
  display: felx;
  width: 393px;
  height: 816px;
  flex-direction: column;
  align-items: center;
  background: #fff;
`;

export const Bar = styled.div`
  position: realtive;
`;

export const Time = styled.div`
  position: absolute;
  color: #000;
  text-align: center;
  font-family: "Pretendard Variable";
  font-size: 18px;
  font-style: normal;
  font-weight: 500;
  line-height: 25px; /* 138.889% */
`;

export const Connecting = styled.div`
  width: 16px;
  height: 12.173px;
  flex-shrink: 0;
`;

export const Wifi = styled.div`
  width: 16px;
  height: 12.173px;
  flex-shrink: 0;
`;

export const Battery = styled.div`
  width: 25px;
  height: 12.173px;
  flex-shrink: 0;
`;

export const Background = styled.div`
  position: relative;
`;

export const Backbtn = styled.div`
  width: 30px;
  height: 30px;
  flex-shrink: 0;
`;

export const Title = styled.div`
  color: #000;
  text-align: center;
  font-family: "Pretendard Variable";
  font-size: 20px;
  font-style: normal;
  font-weight: 700;
  line-height: normal;
  letter-spacing: -0.5px;
`;

export const Date = styled.div`
  position: relative;
`;

export const Before = styled.div`
  width: 11px;
  height: 18.151px;
  flex-shrink: 0;
  stroke-width: 2px;
  stroke: var(--Color-1, #a065ff);
`;

export const Month = styled.div`
  display: flex;
  width: 27px;
  height: 24.958px;
